lockfileVersion: '9.0'

settings:
  autoInstallPeers: true
  excludeLinksFromLockfile: false

importers:

  .:
    dependencies:
      '@ubique-innovation/wasm-share-memory':
        specifier: file:../
        version: file:..

packages:

  '@ubique-innovation/wasm-share-memory@file:..':
    resolution: {directory: .., type: directory}

snapshots:

  '@ubique-innovation/wasm-share-memory@file:..': {}
